.itempannel {
  height: 100%;
  position: absolute;
  left: 0px;
  z-index: 2;
  // background: #f7f9fb;
  background: rgb(246, 249, 252);
  border-right: 1px solid #e6e9ed;
}
.itempannel ul {
  padding: 0px;
  padding-left: 16px;
}
.itempannel li {
  color: rgba(0, 0, 0, 0.65);
  border-radius: 4px;
  width: 160px;
  height: 28px;
  line-height: 26px;
  padding-left: 8px;
  border: 1px solid rgba(0, 0, 0, 0);
  list-style-type: none;
}
.itempannel li:hover {
  background: white;
  border: 1px solid #ced4d9;
  cursor: move;
}

.itempannel .pannel-type-icon {
  width: 16px;
  height: 16px;
  display: inline-block;
  vertical-align: middle;
  margin-left: 8px;
}
.resizer {
  cursor: col-resize;
  position: absolute;
  width: 10px;
  top: 0px;
  bottom: 0px;
  z-index: 99;
  transform: scale(-1,1);
  &:hover {
    background-image: radial-gradient(
      ellipse at center center,
      rgba(0, 0, 0, 0.2) 0%,
      transparent 70%,
      transparent 100%
    );
    background-size: 50px 100%;
    background-position: 0px 50%;
  }
}
